// @flow
import { REQUEST_GNOMES } from "./../actions/types";

function gnomesReducer(state = [], action) {
  switch (action.type) {
    case REQUEST_GNOMES:
      console.log("test")
      console.log(action.payload)
      return action.payload;
    default:
      return state;
  }

}
export default gnomesReducer;
